import React from 'react'
import { Container, Row } from 'react-bootstrap'

const Caballerizas = () => {
  return (
    <Container>
        <Row className='text-center'>
            <h1>CABALLERIZAS</h1>
        </Row>
    </Container>
  )
}

export default Caballerizas
